script: |
  super -f tsv -I q3286.sql | sort > q3286.out

vector: true

inputs:
  - name: q3286.sql
    data: |
      SELECT DISTINCT + CAST ( + 60 AS INTEGER ), - COUNT ( * ) AS col1 FROM tab1 AS cor0 WHERE NOT 50 * - + 47 NOT IN ( - 49, + col1, col1 );
  - name: tab1

outputs:
  - name: q3286.out
    data: |
      60	0
